import React from 'react'
import "./Navbar.css"
import turnerslogo from "../assets/img/turners_trans.png"

function Navbar() {
    return (
        <div>
            <div className="navbar_container"></div>
            <div className="navbar_subcon"></div>
            <img src={turnerslogo} alt="turnerslogo" />
        </div>
    );
};

export default Navbar
